    [],nt"revision_timestamp": "2015-09-01T18:15:02.399868",nt"name": "gis-map-services-and-api-user-guide",nt"isopen":
    true,nt"url": null,nt"notes": "All of the ERS mapping applications, such
    as the Food Environment Atlas and the Food Access Research Atlas, use map services
    developed and hosted by ERS as the source for their map content. These map services
    are open and freely available for use outside of the ERS map applications. Developers
    can include ERS maps in applications through the use of the map service REST API,
    and desktop GIS users can use the maps by connecting to the map server directly.
    Over 30 ERS map services have been created, each containing anywhere from 4 to 70
    map layers. The majority of the services consist of national maps displaying data
    at the county-level.",nt"license_title": "Creative Commons CCZero",nt"extras":
